class InputFactory{constructor(){if(this.constructor===InputFactory)throw new Error("Abstract classes can't be instantiated.")}static getInstance(e,t){if("object"!=typeof e)return e;switch(!0){case InputHelper.inputIsSelectAndMultiple(e):return new InputMultipleValue(e,t);case InputHelper.inputIsSelectAndOne(e):return new SelectInputSingle(e,t);case InputHelper.elementIsTextArea(e):return new InputSingleValue(e,t);case InputHelper.inputIsRadio(e):return new RadioInput(e,t);case InputHelper.inputIsCheckbox(e):return new CheckboxInput(e,t);case InputHelper.elementIsDivAndCheckbox(e):return new DivInputCheckbox(e,t);case InputHelper.elementIsDivAndRadio(e):return new DivInputRadio(e,t);case InputHelper.inputIsFile(e):return new FileInput(e,t);default:return new InputSingleValue(e,t)}}}